pragma solidity ^0.4.24;

interface Main {
  function grabCode(uint256) external payable;
  function priceOf(uint256) external returns (uint256);
  function transferFrom(address,address,uint256) external;
}

contract BulkProxy {
  Main public Token;

  constructor(address target) public {
    Token = Main(target);
  }

  function grabCodes(uint256[] tokens) public payable {
    for (uint i = 0; i < tokens.length; i++) {
      uint256 tokenId = tokens[i];
      //  There is a possible race condition with tokenId owner.
      // When the owner sees that his Token is going to be bought,
      // he can increase price by sending a tx with high gas price.
      //  In order to avoid this race, user of grabCodes should
      // supply just enough ETH to buy all the tiles at expected
      // price. In case of price increase, the whole tx will be
      // reverted.
      //  Another option is to use grabCodesSafe().
      uint256 price = Token.priceOf(tokenId);
      Token.grabCode.value(price)(tokenId);
      Token.transferFrom(address(this), msg.sender, tokenId);
    }
    returnChange();
  }

  function grabCodesSafe(uint256[] tokens, uint256[] prices) public payable {
    for (uint i = 0; i < tokens.length; i++) {
      uint256 tokenId = tokens[i];
      uint256 expectedPrice = prices[i];
      uint256 actualPrice = Token.priceOf(tokenId);
      // In case price was lowered down, buy with lowest price.
      Token.grabCode.value(min(expectedPrice, actualPrice))(tokenId);
      Token.transferFrom(address(this), msg.sender, tokenId);
    }
    returnChange();
  }

  function returnChange() internal {
    uint256 change = address(this).balance;
    if (change == 0) {
      return;
    }
    msg.sender.transfer(change);
  }

  function min(uint256 a, uint256 b) internal pure returns(uint256) {
    if (a < b) {
      return a;
    }
    return b;
  }
}
